import React from "react";
import Ddata from "./Ddata";

const Dcard = () =>{
    return(
        <>
            {Ddata.map((val, index) => {
            return (
            <div className='box product' key={index}>
            <div className='img'>
                <img src={val.cover} alt='' />
            </div>
            <h4>{val.name}</h4>
            <span>${val.price}</span>
            </div>
        )
        })}
        </>
    );
}

export default Dcard ;
